import {Container, Navbar} from 'react-bootstrap'

function App() {
  return (
    <div className="App">
       <Navbar bg="light">
    <Container>
      <Navbar.Brand href="#home">Brand link</Navbar.Brand>
    </Container>
  </Navbar>
  <br />
  <Navbar bg="light">
    <Container>
      <Navbar.Brand>Brand text</Navbar.Brand>
    </Container>
  </Navbar>
    </div>
  );
}

export default App;
